import './LandingPage.css';
import SignUp from '../UserMgmt/Registeration'
import {useState} from 'react'

function LandingPage() {
    const [State, setState] = useState("Register");
    const ChangeState = (StateValue) => {
        setState(StateValue);
    }
    return (
        <div>
            <div class="header">
                <div class="header-left-component">
                    <div>
                        <label>Welcome to landing page</label>
                        </div>
                </div>  
                <div class="header-right-component">
                    <div class="header-right-component-right">
                    <div class="dvSignIn">
                        <label><a href="/">Sign In</a></label>
                    </div>
                    { State == "Register" &&
                            <div class="dvSignUp">
                                <label><a href="/">Sign Up</a></label>
                            </div>
                    }
                    </div>
                    
                </div>
            </div>
            <div class="content">
                <SignUp></SignUp>
            </div>           
        </div>
    );
}
export default LandingPage;
